public class Stack<T> {
    private int size;
    private T[] stack;

    public Stack(int capacity) {
        size = 0;
        stack = (T[]) new Object[capacity];
    }

    public void push(T item) {
        stack[size++] = item;
    }

    public T pop() {
        if (size == 0) throw new IndexOutOfBoundsException("Stack underflow");
        return stack[--size];
    }

    public T peek() {
        return stack[size - 1];
    }

    public boolean isEmpty() {
        return size == 0;
    }

    public int size() {
        return size;
    }
}
```

